var title_f3_19_3389="Americans with Disabilities Act";
var content_f3_19_3389=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F80545&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F80545&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Americans with Disabilities Act",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Title I of the",
"        <strong>",
"         Americans with Disabilities Act of 1990",
"        </strong>",
"        , which took effect July 26, 1992,",
"prohibits private employers, state and local governments, employment",
"agencies, and labor unions from discriminating against qualified",
"individuals with disabilities in job application procedures; hiring;",
"firing; advancement; compensation; job training; and other terms,",
"conditions and privileges of employment. An individual with a",
"disability is a person who:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\" colspan=\"1\">",
"        Has a physical or mental impairment that substantially limits one or more major life activities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Has a record of such an impairment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Is regarded as having such an impairment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        A qualified employee or applicant with a disability is an",
"individual who, with or without reasonable accommodation, can perform",
"the essential functions of the job in question. Reasonable",
"accommodation may include, but is not limited to:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\" colspan=\"1\">",
"        Making existing facilities used by employees readily accessible to and usable by persons with disabilities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Job restructuring",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Modifying work schedules",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Reassignment to a vacant position",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Acquiring or modifying equipment or devices",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Adjusting modifying examinations, training materials, or policies, and providing qualified readers or interpreters",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        An employer is required to make an accommodation",
"to the known disability of a qualified applicant or employee if it",
"would not impose an \"undue hardship\" on the operation of the employer's",
"business. Undue hardship is defined as an action requiring significant",
"difficulty or expense when considered in light of factors such as an",
"employer's size, financial resources, and the nature and structure of",
"its operation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        An employer is not required to lower quality or production",
"standards to make an accommodation, nor is an employer obligated to",
"provide personal use items such as glasses or hearing aids.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Medical examinations and inquiries",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Employers may not ask job applicants about the existence, nature, or",
"severity of a disability. Applicants may be asked about their ability",
"to perform specific job functions. A job offer may be conditioned on",
"the results of a medical examination, but only if the examination is",
"required for all entering employees in similar jobs. Medical",
"examinations of employees must be job related and consistent with the",
"employer's business needs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Drug and alcohol abuse",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Employees and applicants currently engaging in the illegal use of drugs",
"are not covered by the ADA when an employer acts on the basis of such",
"use. Tests for illegal drugs are not subject to the ADA's restrictions",
"on medical examinations. Employers may hold illegal drug users and",
"alcoholics to the same performance standards as other employees.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        EEOC enforcement of the ADA",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The U.S. Equal Employment Opportunity Commission issued regulations to",
"enforce the provisions of Title I of the ADA on July 26, 1991. The",
"provisions originally took effect on July 26, 1992, and covered",
"employers with 25 or more employees. On July 26, 1994, the threshold",
"dropped to include employers with 15 or more employees.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
