"   <div class=\"lgnd\">",
"    Gram stain of unspun urine (x1000) shows an inflammatory cell and numerous Gram-negative bacilli. Escherichia coli grew from this specimen. The presence of one or more bacteria per oil immersion field of fresh unspun urine usually indicates infection with 100,000 or more organisms per mL.",
